import Root from "./route/Root";
import { CreateUrl, UrlList, WorldsContainer, Signin, Signup } from "./route";
import { ROUTES } from "./constants";

const routes = [
  {
    component: Root,
    routes: [
      {
        path: ROUTES.HOME,
        exact: true,
        component: CreateUrl,
        privatePath: false
      },{
        path: ROUTES.LIST,
        exact: true,
        component: UrlList,
        privatePath: true
      },{
        path: ROUTES.WORDS,
        exact: true,
        component: WorldsContainer,
        privatePath: true
      },{
        path: ROUTES.SIGNIN,
        exact: true,
        component: Signin,
        privatePath: false,
        redirect: true,
      },{
        path: ROUTES.SIGNUP,
        exact: true,
        component: Signup,
        privatePath: false
      }
    ]
  }
];

export default routes;
